import React from 'react';
import ReactDom from 'react-dom/client';
import './style.css';
import one from './assets/image/one.jpg';
import two from './assets/image/two.jpg';
import three from './assets/image/three.jpg';

const root = ReactDom.createRoot(document.getElementById("root"));
function Navbar() {
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Prodct |</li>
        <li>About |</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
};
function Search() {
  return(
    <div className='searchbar'>
      <input type='text' placeholder='Search'></input>
    </div>
  )
};
function Prodct() {
  return(
    <div class="products">
    <div class="box">

                <img src={one}></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
    </div>


    <div class="box">
        <img src={two} alt="villain"></img>
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
    </div>
    <div class="box">
        <img src={three} alt="Designs Club"></img>
        <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
    </div>
    </div>
  )
};
function About() {
  return(
    <div style="text-align: center;">
    <div class="about" style="margin-top: 10px; text-align: center;">
        <h1>About Us</h1>
        <p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>
    </div>
    </div>
  )
};



root.render(
  <div>

    <Navbar />
    <Search />
    <Prodct />
    <About />
  </div>
)
